import React, { Component } from 'react';

export default class Todoitem extends Component {
    render() {
        return (
            <ul class="list-group my-5">
                <h3 class="text-capitalize text-center">
                    todo list </h3>
                    <button type="submit"></button>
            </ul>

        )
    }
}
